import './App.css';
import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

const users = ["Holly", "Steve", "Jason"];

function App() {
  return (
    <div>    
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
            </ul>
          </nav>
          <p>renderer below</p>
          <Routes>
            <Route path="/" element={<Home/>} />
            <Route path="/users" element={<Users/>} />
            <Route path="/about" element={<About/>} />
          </Routes>
          <p>renderer above</p>
        </div>
      </Router>
    </div>
  )
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return(
    <div>
      <h2>Users</h2>
      <nav>
        <ul>
          {LinkList("/users", users)}
        </ul>
      </nav>
    </div>
  )
}

function LinkList(root, lis) {
  return(
    lis.map(li => 
      <li>
        <Link to={`${root}/${li}`}>{li}</Link>
      </li>
    )
  )
}


export default App;
